  true,\n\t\"url\": null,\n\t\"notes\": \"Invocon proposes the Surface-borne Time-Of-Reception
  Measurementsn(STORM) system as a method to locate the position of lightning strikesnon
  aerospace vehicles.  Initially developed as a hypervelocity impactnlocation system,
  the baseline technology lends itself to simplenadaptation for lightning location.
  \ It uses Time-Of-Arrival (TOA)nmeasurements of the charge wave front imparted on
  a structure tontriangulate the location of lightning attachment.  Additional capabilityncan
  be added to the triggering circuitry that will characterize thenlightning strike
  in order to increase situational awareness for flightncrews and provide maintenance
  crews with information vital to determinenthe health of an aircraft.  This is particularly
  important for newnairframes manufactured from composite materials that have not
  be fullyncharacterized over the full lifetime of the aircraft.\",\n\t\"license_title\":
